import React from 'react'

const JackpotPlayers = [
    {name: "ronnie", id: "j1", skore: 0},
    {name: "roopa", id: "j2", skore: 0},
    {name: "ravi", id: "j3", skore: 0},
    {name: "rishika", id: "j4", skore: 0},
    {name: "anu", id: "j5", skore: 0}
]
//give an option since we played with this gang last time for a big game 
//if full gang is playing display till 5
//else till 3

export default JackpotPlayers
